import React from "react";
import { IQuality } from "../../../types/types";

const Quality: React.FC<IQuality> = ({ _id, color, name }) => {
    return (
        <span className={"badge m-1 bg-" + color} key={_id}>
            {name}
        </span>
    );
};

export default Quality;
